import { Col, Row, Typography } from 'antd';
import React from 'react';
import { API_KEY } from '../../constants/api-keys';

function DetailMovieInfo(props) {
	const { Text, Title } = Typography;
	const {
		backdrop_path,
		belongs_to_collection,
		genres,
		homepage,
		overview,
		popularity,
		poster_path,
		production_companies,
		production_countries,
		release_date,
		revenue,
		runtime,
		spoken_languages,
		status,
		tagline,
		title,
		vote_average,
		vote_count,
	} = props;
	const imgUrl = API_KEY.IMAGE_URL;
	console.log(props);
	return (
		<Row gutter={[16, 16]}>
			<Col span={12}>
				<img src={`${imgUrl}${poster_path}`} />
			</Col>

			<Col span={12}>
				<Title level={1}>{title}</Title>
			</Col>
		</Row>
	);
}

export default DetailMovieInfo;
